import React from 'react';
import { Navigate, Route } from 'react-router-dom';

const PrivateRoute = ({ element, path }) => {
  // Check if the user is authenticated (e.g., check for the presence of required cookies)
  const isAuthenticated = /* Logic to check if user is authenticated, for example: */ document.cookie.includes('patientId');

  return isAuthenticated ? (
    <Route path={path} element={element} />
  ) : (
    <Navigate to="/login" />
  );
};

export default PrivateRoute;
